import React from 'react'

import './Body.scss'

export const Body = ({ title }) => {
    return(
        <div className='fixed-conteiner'>
            <div className="container">
            <img className='ivan' src="/images/ivan.png"></img>
            <h1 className='front'>FRONTEND DEVELOPER</h1>
            { title }
            </div>

        </div>
    )
}
